var app=angular.module("clientApp",["ngRoute"]);app.controller("MainController",["$scope",function(a){function b(a){return Math.floor(Math.random()*(1+a-0)+0)}a.newGrid=function(){var c=["Blue","Blue","Blue","Blue","Blue","Blue","Blue","Blue","Red","Red","Red","Red","Red","Red","Red","Red","Black","Grey","Grey","Grey","Grey","Grey","Grey","Grey","Purple"];for(a.gridArray=[],i=0;i<25;i++){var d=c.length-1,e=b(d);a.gridArray.push(c[e]),c.splice(e,1)}console.log(a.gridArray)}}]);